def dungeon_rescue(dungeon):
    m, n = len(dungeon), len(dungeon[0])
    dp = [[0] * n for _ in range(m)]
    for i in range(m):
        for j in range(n):
            if i == 0 and j == 0:
                dp[i][j] = 1
            elif i == 0:
                dp[i][j] = dp[i][j-1] + dungeon[i][j]
            elif j == 0:
                dp[i][j] = dp[i-1][j] + dungeon[i][j]
            elif i == m-1:
                dp[i][j] = dp[i-1][j] + dungeon[i][j]
            else:
                dp[i][j] = max(dp[i-1][j], dp[i][j-1]) + dungeon[i][j]
    return dp[-1][-1]

