def inv(x):
    return pow(x, MOD - 2, MOD)


def fact(n):
    if n == 0 or n == 1:
        return 1
    else:
        return n * fact(n - 1)


def ncr(n, r):
    if n < r:
        return 0
    if r == 0:
        return 1
    return fact(n) // (fact(r) * fact(n - r))


