    for i in range(len(cards)):
        for j in range(len(cards[i])):
            for k in range(len(cards[i][j])):
                for l in range(len(cards[i][j][k])):
                    if cards[i][j][k][l] == cards[i-1][j][k][l]:
                        return False
    return True


def find_tie(cards):
    for i in range(len(cards)):
        for j in range(len(cards[i])):
            for k in range(len(cards[i][j])):
                for l in range(len(cards[i][j][k])):
                    if cards[i][j][k][l] == cards[i-1][j][k][l]:
                        return cards[i-1][j][k][l]
    return None


